import React from 'react'

const Button = ({props}) => {
    console.log("props"+props)
    const color = props
    const background = document.getElementById('root').style
    return (
        <button style={{color: color}} onClick={() => (background.backgroundColor = color)}>{background.backgroundColor}</button>
    )
}
 
export default Button
